import { Component } from '@angular/core';
import { Cliente } from './cliente.model';

@Component({
  selector: 'app-cliente',
  templateUrl: './cliente.component.html',
  styleUrls: ['./cliente.component.css']
})
export class ClienteComponent {
  mensagem : string = "";
  obj: Cliente = new Cliente();

  public mostrar(){
    this.mensagem = "Boa noite fatec ipiranga!";
    this.obj.codigo = 1;
    this.obj.email = "maria@norton.net.br";
    this.obj.nome = "maria";
    this.obj.telefone = "4355-3455";  
  }
}
<h2>Cadastro de Cliente</h2>
<h3>{{mensagem}}</h3>

Codigo:<b>{{obj.codigo}}</b><br>
Nome:<b>{{obj.nome}}</b><br>
Email:<b>{{obj.email}}</b><br>
Telefone:<b>{{obj.codigo}}</b><br>
